method.script:
var ord = Order.getOrderById(this.OrderId);

if(ord.FacilityData){
    this.acessoGPON = ord.FacilityData.acessoGPON;
    this.estacao = ord.FacilityData.estacao;
}
if(!ord.FacilityData || this.estacao==null){
    if(ord.OriginalData && ord.OriginalData[0]){
        this.estacao = ord.OriginalData[0].FacilityData.estacao;
    }
}
if(!this.acessoGPON){
    if(ord.OriginalData && ord.OriginalData[0]){
        this.acessoGPON = ord.OriginalData[0].FacilityData.acessoGPON;
    }
}

this.numeroPedido = ord.OrderHeader.numeroPedido;
this.listaSolicitacoes = ord.OrderHeader.listaSolicitacoes;

if(ord.ManualActivityData){
    var obs = "";
    for(var i=0; i<ord.ManualActivityData.length; i++){
        if(ord.ManualActivityData[i].ManualActivityData.statusAtividade == false){//not closed manual ativity
            obs = ord.ManualActivityData[i].ManualActivityData.observacao;
            break;
        }
    }
    this.observacao = obs;
}

var searchEvents = new Document('FTTHCommon:Event');
searchEvents.cwOrderId = ord.OrderHeader.cwOrderId;
var errorCode = Finder.runSearch('override_cwf_pm:GetAvailableFinder', searchEvents);

if (errorCode != null) {
    if (errorCode.size > 0) {
        this.codigoErro = errorCode[0].codigo;
    }
}

//this.createDate = this.createDate;
